import React from 'react';
import Theteam from "./theteam"
import {Switch, Route} from "react-router-dom"

export default function Routes(){
    return (
        <Switch>
            <Route exact path="/theteam">
                <Theteam/>
            </Route>
        </Switch>
    );
}
